def index_data(word,data):
    man_rate = 0.52
    woman_rate = 0.48
    try:
        word_in_man_rate = data[word]['男'] + 0.000000000001
        word_in_woman_rate = data[word]['女'] + 0.00000000001
    except KeyError:
        word_in_man_rate = 0.51
        word_in_woman_rate = 0.49
    up_calculate = man_rate * word_in_man_rate
    low_calculate = man_rate * word_in_man_rate + woman_rate * word_in_woman_rate
    return up_calculate/low_calculate

def beyes_name_predict(name,data1):
    record = []
    rate = 0
    for word in name[1:]:
        record.append(index_data(word,data1))
    for may_be_rate in record:
        rate = rate + may_be_rate
    rate = rate/len(record)
    return rate

